package javaclass;

public class for1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,num=5,res;
		System.out.println("Multiplication table");
		for(i=1;i<11;i++)
		{
			res=i*num;
			System.out.println("The multiplication of 5: "+res);
		}
		
	}
}
